import React from "react";
import { NavLink } from "react-router-dom";
export default function Nav() {
  return (
    <nav>
      <NavLink exact to="/">
        Home
      </NavLink>
      <NavLink to="/authors">Authors</NavLink>
      <NavLink to="/login">Login</NavLink>
    </nav>
  );
}
